# BINARY SEARCH

from time import *

def binary_search(Arr, x):
    l = 0
    r = len(Arr)-1
    q = 0
    while l <= r:
        q = (r + l) // 2
        if Arr[q] < x:
            l = q + 1
        elif Arr[q] > x:
            r = q - 1
        else:
            return q
    return -1
 
